import React from 'react';
import 'styles/About.css'; // Add CSS for styling

const About = () => {
  return (
    <div className="about-container">
      <h1>About Fruit.AI</h1>
      <p>
        Fruit.AI is a health manager designed to help you discover and learn
        more about fruits, translations, and FAQs about fruits. Stay healthy with
        Fruit.AI!
      </p>
    </div>
  );
};

export default About;
